import React, { Component } from 'react'

export default class Apout extends Component {
    render() {
        return (
            <>
                <div>
                    <h1 className='text-uppercase fw-bolder fs-1'>A</h1>
                        <i class="fa fa-star fs-1 "></i>
                </div>
            </>
        )
    }
}
